import React, { PureComponent } from 'react';
import {ResponsiveContainer, BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend,} from 'recharts';
import './Graph2.css';

const DataFormater = (number) => {
    if(number > 1000000000){
      return (number/1000000000).toString() + 'B';
    }else if(number > 1000000){
      return (number/1000000).toString() + 'M';
    }else if(number > 1000){
      return (number/1000).toString() + 'K';
    }else{
      return number.toString();
    }
}

const data = [
  {
    name: 'Gr1', uv: 4000, pv: 2400, amt: 2400,
  },
  {
    name: 'Gr2', uv: 3000, pv: 1398, amt: 2210,
  },
  {
    name: 'Gr3', uv: 2000, pv: 9800, amt: 2290,
  },
];

export default class Example extends PureComponent {
  static jsfiddleUrl = 'https://jsfiddle.net/alidingling/q4eonc12/';

  render() {
    return (
      <div className="widgetGraph2">
        <h5>Class Data</h5>
        <div style={{ width: '100%', height: 300 }}>
            <ResponsiveContainer>
                <BarChart width={500} height={300} data={data} margin={{top: 5, right: 30, left: 20, bottom: 5,}} barSize={20}>
                  <XAxis dataKey="name" scale="point" padding={{ left: 10, right: 10 }} />
                  <YAxis tickFormatter={DataFormater}/>
                  <Tooltip />
                  <CartesianGrid strokeDasharray="3 3" />
                  <Bar dataKey="pv" fill="#8884d8" background={{ fill: '#eee' }} />
              </BarChart>
          </ResponsiveContainer>
      </div>
    </div>
    );
  }
}
